var errorimg = "";
var error = "<img height=50 width=50 src=\"data:image/png;base64," + errorimg + "\"/><span style=\"font-size:20px;vertical-align:15px\">Operation could not be completed.</span>";
function GetAll(element) {
    $.ajax({
        url: "/all",
        type: "post",
        success: function (response) {
            if (!(response === null || $.trim(response) === "" || response === "[]")) {
                element.innerHTML = "";
                var data = JSON.parse(response);
                data.forEach(function (item) {
                    var div = document.createElement("div");
                    div.style.margin = "10px";
                    div.style.padding = "10px";
                    div.style.borderRadius = "5px";
                    div.style.background = "#e0e0e0";
                    var ico = document.createElement("img");
                    ico.src = "/Images/Server.svg";
                    ico.width = 40;
                    ico.height = 40;
                    ico.style.verticalAlign = "-13px";
                    div.appendChild(ico);
                    var text = document.createElement("span");
                    text.style.fontSize = "20px";
                    text.innerText = item.Name;
                    div.appendChild(text);
                    var ip = document.createElement("span");
                    ip.style.fontSize = "20px";
                    ip.style.marginLeft = "50px";
                    ip.innerText = item.IP;
                    div.appendChild(ip);
                    var button = document.createElement("a");
                    button.href = "/Manage/Index.html?Name=" + item.Name;
                    button.className = "blue_button";
                    button.innerText = "Manage";
                    button.style.marginTop = "0px";
                    button.style.float = "Right";
                    div.appendChild(button);
                    var platform = document.createElement("span");
                    platform.style.fontSize = "20px";
                    platform.style.marginRight = "50px";
                    platform.style.marginTop = "3px";
                    platform.style.float = "Right";
                    platform.innerText = item.Platform;
                    div.appendChild(platform);
                    element.appendChild(div);
                });
            }
        },
        error: function () {
            element.innerHTML = error;
        }
    });
}

function GetInfo(element, name) {
    $.ajax({
        url: "/info?" + name,
        type: "post",
        success: function (response) {
            element.innerText = response;
        },
        error: function () {
            element.innerHTML = error;
        }
    });
}

function Add(form, stateblock) {
    var array = $(form).serializeArray();
    var objs = {};
    for (var i = 0; i < array.length; i++) {
        objs[array[i].name] = array[i].value;
    }
    $.ajax({
        url: "/add",
        data: JSON.stringify(objs),
        type: "post",
        success: function () {
            window.location.href = "/";
        },
        error: function () {
            stateblock.innerHTML = error;
        }
    });
}

function manage(page) {
    window.location.href = "/Manage/" + page + "?" + window.location.href.split('?')[1];
}
var locks = [];
async function GetPerformance(name, stateblock) {
    var result = "";
    if (!locks.includes(name)) {
        locks.push(name);
        await $.ajax({
            url: "/performance/" + name,
            type: "post",
            success: function (data) {
                stateblock.innerHTML = "";
                result = data;
                locks.splice(locks.indexOf(name), 1);
            },
            error: function () {
                stateblock.innerHTML = error;
                locks.splice(locks.indexOf(name), 1);
            }
        });
    }
    return result;
}
function GetProcesses(element) {
    var name = "GetProcesses?" + window.location.href.split('?')[1];
    if (!locks.includes(name)) {
        locks.push(name);
        $.ajax({
            url: "/process/" + name,
            type: "post",
            success: function (response) {
                var top = element.scrollTop;
                element.innerHTML = "";
                var data = JSON.parse(response);
                for (var key in data) {
                    var block = document.createElement("div");
                    block.style.padding = "10px";
                    block.style.borderBottom = "1px #e0e0e0 solid";
                    block.innerHTML = "<span>" + key + "</span>" + "<span style=\"margin-left:10px\">" + data[key] + "</span>";
                    element.appendChild(block);
                }
                locks.splice(locks.indexOf(name), 1);
                element.scrollTop = top;
            },
            error: function () {
                element.innerHTML = error;
                locks.splice(locks.indexOf(name), 1);
            }
        });
    }
}
function GetDrives(element) {
    if (!locks.includes(name)) {
        locks.push(name);
        $.ajax({
            url: "/file/GetAll?" + window.location.href.split('?')[1],
            type: "post",
            success: function (response) {
                var top = element.scrollTop;
                var data = JSON.parse(response);
                var driveblock=document.createElement("div");
                data.forEach(async function (name) {
                    var block = document.createElement("div");
                    block.style.padding = "10px";
                    block.style.borderBottom = "1px #e0e0e0 solid";
                    block.innerHTML = "<span style=\"font-size:20px\">" + name + "</span>";
                    var total = document.createElement("div");
                    var free = document.createElement("div");
                    var totalsize = 1;
                    await $.ajax({
                        url: "/file/GetTotal?" + "drivename=" + JSON.stringify(name).replace(new RegExp("/", "g"), "|").replace(/\\/g, "|") + "&" + window.location.href.split('?')[1],
                        type: "post",
                        success: function (response) {
                            totalsize = response;
                            total.innerText = "Total:" + (response / 1024 / 1024 / 1024).toFixed(2) + "GB";
                            block.appendChild(total);
                        },
                        error: function () {
                            element.innerHTML = error;
                        }
                    });
                    await $.ajax({
                        url: "/file/GetFree?" + "drivename=" + JSON.stringify(name).replace(new RegExp("/", "g"), "|").replace(/\\/g, "|")+"&"+ window.location.href.split('?')[1] ,
                        type: "post",
                        success: function (response) {
                            free.innerText = "Free:" + (response / 1024 / 1024 / 1024).toFixed(2) + "GB";
                            block.appendChild(free);
                            var div = document.createElement("div");
                            div.style.width = (totalsize - response) / totalsize * 90 + "%";
                            div.style.height = "5px";
                            div.style.borderRadius = "2.5px";
                            div.style.backgroundColor = "royalBlue";
                            div.style.margin = "10px";
                            block.appendChild(div);
                        },
                        error: function () {
                            element.innerHTML = error;
                        }
                    });
                    driveblock.appendChild(block);
                });
                element.innerHTML = "";
                element.appendChild(driveblock);
                locks.splice(locks.indexOf(name), 1);
                element.scrollTop = top;
            },
            error: function () {
                element.innerHTML = error;
                locks.splice(locks.indexOf(name), 1);
            }
        });
    }
}
